import React, { useState } from "react";

import { Route , Routes } from "react-router";
import Login from "./Login/Login";
const url = "http://localhost:8080"

export const App = () =>{

    return(
        
        <React.StrictMode>
        <BrowserRouter>
          <Routes>
            <Route path='/login' Component={<Login></Login>}></Route>
    
          </Routes>
        </BrowserRouter>
      </React.StrictMode>
    )
}
